		function setBlocks() {
			for (var i = 0 ; i < 120 ; ++i) {
				if (stagei < 120) {
					infMult = nd(1);
				}
				else {
					infMult = nd(1.1487).pow(stagei - 119);
				}
				blocks[i] = retBlock();
				blockMHP[i] = blockHPset(blocks[i]).times(infMult);
				blockHP[i] = blockMHP[i];
			}
		}
		
		
