		this.plusLv.addEventListener("click", setPlus.bind(this));
		function setPlus() {
			PokiSDK.gameplayStop();
			gamePlay = false;
			window.focus();
			PokiSDK.commercialBreak().then(() => {
				PokiSDK.gameplayStart();
				gamePlay = true;
			});
			stagei += 1;
			setChances();
			setBlocks();
			cooldownMove = 5;
			if (tutor == 6) {
				tutor = 7;
			}
		}
		
		
